import './App.css'
import { useState } from 'module'
import SignIn from './pages/SignIn/SignIn'
import Home from './Home'
import AddUser from './AddUser'
import Dashboard from './pages/Dashboard/Dashboard'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import { Navigate } from 'react-router-dom'

function App() {
  const [tokenAdmin, setTokenAdmin] = useState('')
  const [tokenUser, setTokenUser] = useState('')

  const tokenAd = localStorage.getItem('tokenAdmin')
  const tokenUs = localStorage.getItem('tokenUser')

  tokenAdmin ? setTokenAdmin(tokenAd) : setTokenAdmin('')
  tokenUser ? setTokenUser(tokenUs) : setTokenUser('')

  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<SignIn />} />
        {tokenUser && <Route exact path="/dashboard" element={<Dashboard />} />}
        {tokenAdmin && <Route exact path="/home" element={<Home />} />}
        {tokenAdmin && <Route exact path="/add" element={<AddUser />} />}
        <Route exact path="*" element={<SignIn />} />
      </Routes>
    </Router>
  )
}

export default App
